import Header from './components/Header'
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Switch>
          <Route path='/' exact> </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
